/* Model creation/destruction functions */

void MODEL_mkSimTop::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkSimTop_instance = new MOD_mkSimTop(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkSimTop_instance->INST_si_streamAQ.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_streamBQ.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_unrollQs_0.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_unrollQs_1.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_unrolledQs_0.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_unrolledQs_1.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_intersectedQ.set_clk_0)("CLK");
  (mkSimTop_instance->INST_si_streamOutQ.set_clk_0)("CLK");
  (mkSimTop_instance->set_clk_0)("CLK");
}
void MODEL_mkSimTop::destroy_model()
{
  delete mkSimTop_instance;
  mkSimTop_instance = NULL;
}
void MODEL_mkSimTop::reset_model(bool asserted)
{
  (mkSimTop_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkSimTop::get_instance()
{
  return mkSimTop_instance;
}

