/* VCD dumping functions */
MOD_mkSimTop & mkSimTop_backing(tSimStateHdl simHdl)
{
  static MOD_mkSimTop *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkSimTop(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkSimTop::dump_VCD_defs()
{
  (mkSimTop_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkSimTop::dump_VCD(tVCDDumpType dt)
{
  (mkSimTop_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkSimTop_backing(sim_hdl));
}
